import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom'; // Corrected import for navigation
import axios from 'axios'; // For API requests
import '../App.css'; // Global styling

const AddQuestion = () => {
    const [question, setQuestion] = useState('');
    const [options, setOptions] = useState(['', '', '']);
    const [correctOption, setCorrectOption] = useState('');
    const [mark, setMark] = useState('');
    const [negativeMark, setNegativeMark] = useState('');
    const [loading, setLoading] = useState(false);
    const [successMessage, setSuccessMessage] = useState('');
    const [error, setError] = useState('');

    const navigate = useNavigate(); // Corrected navigation hook

    const handleOptionChange = (index, value) => {
        const newOptions = [...options];
        newOptions[index] = value;
        setOptions(newOptions);
    };

    const addOption = () => {
        setOptions([...options, '']);
    };

    const handleSubmit = async () => {
        setLoading(true);
        try {
            const response = await axios.post('http://localhost:8000/staff/addquestion/', {
                question,
                options,
                correctOption,
                mark,
                negativeMark,
            });

            if (response.status === 200) {
                setSuccessMessage('Question added successfully!');
                setError(null); // Clear any error
            }
        } catch (err) {
            setError('Failed to add question. Please try again.');
            setSuccessMessage(''); // Clear success message on error
        } finally {
            setLoading(false);
        }
    };

    return (
        <div className="add-question-container">
            <h1>Add Question</h1>
            <div className="form-group">
                <label>Question*</label>
                <textarea
                    value={question}
                    onChange={(e) => setQuestion(e.target.value)}
                    placeholder="Enter your question here"
                />
            </div>

            <div className="form-group">
                <label>Options*</label>
                {options.map((option, index) => (
                    <input
                        key={index}
                        type="text"
                        value={option}
                        onChange={(e) => handleOptionChange(index, e.target.value)}
                        placeholder={`Option ${index + 1}`}
                    />
                ))}
                <button onClick={addOption}>Add Option</button>
            </div>

            <div className="form-group">
                <label>Correct Option*</label>
                <input
                    type="text"
                    value={correctOption}
                    onChange={(e) => setCorrectOption(e.target.value)}
                    placeholder="Enter the correct option"
                />
            </div>

            <div className="form-group">
                <label>Mark*</label>
                <input
                    type="text"
                    value={mark}
                    onChange={(e) => setMark(e.target.value)}
                    placeholder="Enter marks for the question"
                />
            </div>

            <div className="form-group">
                <label>Negative Mark*</label>
                <input
                    type="text"
                    value={negativeMark}
                    onChange={(e) => setNegativeMark(e.target.value)}
                    placeholder="Enter negative marks for the question"
                />
            </div>

            {loading && <p>Submitting...</p>}
            {successMessage && <p className="success-message">{successMessage}</p>}
            {error && <p className="error-message">{error}</p>}

            <div className="form-actions">
                <button onClick={handleSubmit}>Submit</button>
                <button onClick={() => navigate(-1)}>Back</button> {/* Updated Back Button */}
            </div>
        </div>
    );
};

export default AddQuestion;
